One of my favorite date nights ever 🌊🦞🌅

@themarineroom sits right on the water in La Jolla with an excellent surf and turf menu and wine and cocktail list. Loved watching the waves and sunset over the Pacific while eating the most delicious crab stuffed lobster. Highly recommend for a special occasion!

