Looking for a Halloween event in Austin that’s fun for kids and adults?? 

@musiclaneaustin is hosting a Spooky Sip & Stroll on Thurs. Oct. 26 from 4-7 pm with trick or treating in stores, live music, photos, tarot card reading, hair tinseling & glitter tattoos, sips, a $500 shopping spree giveaway and more!  The event is free, just RSVP through @musiclaneaustin 

